<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no"/>
  <title>8bitsoft</title>
  <style>
    @import url('https://fonts.googleapis.com/css2?family=Nunito:wght@600;800&display=swap');

    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }
    html, body {
      width: 100%;
      height: 100dvh;
      overflow: hidden;
      font-family: 'Nunito', sans-serif;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      text-align: center;
    }
    .logo {
      width: 260px;
      max-width: 80vw;
      height: auto;
      margin-bottom: 2rem;
    }
    footer {
      font-size: 1.1rem;
      font-weight: 800;
    }
    footer a {
      text-decoration: none;
      font-weight: 800;
      letter-spacing: 0.5px;
    }
    footer a:hover {
      text-decoration: underline;
    }

    /* Light theme (default) */
    @media (prefers-color-scheme: light) {
      body {
        background: radial-gradient(circle at top left, #e4ecf7, transparent 60%),
                    radial-gradient(circle at bottom right, #ffe0e0, transparent 60%),
                    radial-gradient(circle at top right, #c8fff4, transparent 60%),
                    radial-gradient(circle at center, #f2f2f2, #dcdcdc);
        background-color: #f0f4f8;
        color: #2a2a2a;
      }
      footer a {
        color: #2a2a2a;
      }
    }

    /* Dark theme */
    @media (prefers-color-scheme: dark) {
      body {
        background: radial-gradient(circle at top left, #222, transparent 60%),
                    radial-gradient(circle at bottom right, #111, transparent 60%),
                    radial-gradient(circle at top right, #333, transparent 60%),
                    radial-gradient(circle at center, #000, #111);
        background-color: #000;
        color: #f0f0f0;
      }
      footer a {
        color: #f0f0f0;
      }
    }
  </style>
</head>
